    requestOptions: {
      location: {
        lat: () => 41.878113,
        lng: () => -87.629799,
      },
      radius: 200 * 1000
    }
  });
  return (
  <Combobox onSelect={(address) => {console.log(address)}}>
    <ComboboxInput value={value} onChange={(e) => setValue(e.target.value)}/>
  </Combobox>
  );
}

export default Search
